    return (
        <Grid>
            <Grid.Row>
                <Grid.Col>
                    <Image />
                </Grid.Col>
                <Grid.Col></Grid.Col>
                <Grid.Col></Grid.Col>
            </Grid.Row>
        </Grid>
    )
}
